export default {
    name: 'watchShare',

    data: function() {
        return {
            hasWatchToShow: false,
            watch: {}
        }
    },

    methods: {
    },

    computed: {

    },

    created() {
        const urlParams = new URLSearchParams(window.location.search);
        const watchId = urlParams.get('watchId');
        this.$store.dispatch('getWatchShareById', watchId).then(watch => {
            this.watch = watch
            this.hasWatchToShow = true;
        })
    }

}
